#include <stdio.h>
int main() {
    int arr[] = {3, 6, 9, 12, 15};
    int result = 0;
    for(int i = 0; i < 5; i++) {
        if(arr[i] % 3 == 0 && i % 2 != 0)
            result += arr[i];
    }
    printf("%d", result);
    return 0;
}

#include <stdio.h>
int main() {
    char str1[] = "APPLE";
    char str2[10];
    int i = 0;
    while(str1[i] != '\0') {
        str2[i] = str1[i];
        i++;
    }
    str2[i] = '\0';
    printf("%s", str2);
    return 0;
}

#include <stdio.h>
int fib(int n) {
    if(n <= 1) return n;
    return fib(n-1) + fib(n-2);
}
int main() {
    printf("%d", fib(6));
    return 0;
}

#include <stdio.h>
int main() {
    int x = 20, y = 30;
    int z = (x > y) ? (x - y) : (y - x);
    printf("%d", z * 2);
    return 0;
}

#include <stdio.h>
int main() {
    int matrix[3][2] = {{1, 2}, {3, 4}, {5, 6}};
    int sum = 0;
    for(int i = 0; i < 3; i++)
        sum += matrix[i][0];
    printf("%d", sum);
    return 0;
}

#include <stdio.h>
int main() {
    int n = 456, digit_sum = 0;
    while(n > 0) {
        digit_sum += n % 10;
        n /= 10;
    }
    printf("%d", digit_sum);
    return 0;
}

#include <stdio.h>
void change(int arr[], int size) {
    for(int i = 0; i < size; i++)
        arr[i] += 10;
}
int main() {
    int data[] = {5, 10, 15};
    change(data, 3);
    printf("%d", data[1]);
    return 0;
}

#include <stdio.h>
int main() {
    char competition[] = "BATTLE OF BEGINNERS";
    int letters = 0;
    for(int i = 0; competition[i] != '\0'; i++) {
        if(competition[i] != ' ')
            letters++;
    }
    printf("%d", letters);
    return 0;
}

#include <stdio.h>
int main() {
    int a = 7, b = 14, c = 21;
    if(a < b && b < c)
        if(c % a == 0)
            printf("%d", c / a);
        else
            printf("%d", b / a);
    else
        printf("%d", 0);
    return 0;
}

