#include <stdio.h>
int count = 0;
void increment() {
    count += 2;
}
int main() {
    increment();
    increment();
    increment();
    printf("%d", count);
    return 0;
}

#include <stdio.h>
int main() {
    int arr[2][3] = {{2, 4, 6}, {8, 10, 12}};
    int total = 0;
    for(int i = 0; i < 2; i++)
        for(int j = 0; j < 3; j++)
            if(j % 2 == 0)
                total += arr[i][j];
    printf("%d", total);
    return 0;
}

#include <stdio.h>
int main() {
    int i = 5, sum = 0;
    do {
        sum += i;
        i--;
    } while(i > 2);
    printf("%d", sum);
    return 0;
}

#include <stdio.h>
int calculate(int x, int y) {
    return (x * x) + (y * y);
}
int main() {
    printf("%d", calculate(3, 4));
    return 0;
}

#include <stdio.h>
int main() {
    int arr[] = {11, 22, 33, 44, 55};
    int max = arr[0];
    for(int i = 1; i < 5; i++)
        if(arr[i] > max)
            max = arr[i];
    printf("%d", max);
    return 0;
}

